import React from "react";
import "../App.css";
const Footer = () => {
  return (
    <div className="footerMain">
      <footer className="text-center bg-info p-10">
        <p>
          Copyrights @ 2021 TFP Solutions Bangladesh Ltd. All Rights Reserved |
          Terms and Conditions.
        </p>
      </footer>
    </div>
  );
};

export default Footer;
